import React, { useEffect, useState } from "react";
import Table from "./Table";

const AdminHome = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5050/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userData");
        setData(data.data);
      });
  }, []);

  const logout = () => {
    window.localStorage.clear();
    window.location.href = "./";
  };

  return (
    <div>
      <div className="bg-zinc-400 h-screen flex justify-center items-center">
        {data.map((userData) => (
          <Table key={userData._id} userData={userData} />
        ))}

        <button
          onClick={logout}
          className="flex justify-center items-center bg-slate-900 w-20 h-7 text-white rounded-full mb-2 ml-2"
        >
          Log Out
        </button>
      </div>
    </div>
  );
};

export default AdminHome;
